import React from "react";
import mcqData from "./data";

const QueAns = () => {
  return (
    <>
      <div>
        {mcqData.map((elem) => {
          let { id, que, ans } = elem;
          return (
            <>
            <div>
                
            </div>
              {id}
              {que}
              {ans}
            </>
          );
        })}
      </div>
    </>
  );
};

export default QueAns;
